    null,ntt"hash": "",ntt"description": "TIFF is a format for storage,
    transfer, display, and printing of raster images. The TIFF file structure allows
    both the tag and the image data to be encoded into the same file. GeoTIFF refers
    to a TIFF file that has geographic data embedded as tags within the TIFF file. The
    geographic data can be used to position the image in the correct location and geometry
    on the screen of a geographic information display. Any GIS, CAD, Image Processing,
    Desktop Mapping and other types of systems using geographic images can read any
    GeoTiff file. More specifically, files of this type can be added to ArcInfo and
    ArcView 8.x or higher and may be viewed in the Table of Contents as a new raster
    layer. Image visualization software that does not use geography as a basis for image
    placement can view a GeoTIFF image as if there were no geographic information in
    the TIFF file. For example, GeoTIFF files can be viewed using Windows Picture and
    Fax viewer. The GeoTIFF format is public domain, non-proprietary.",ntt"format":
