    from gridded bathymetry for selected U.S. locations in the Pacific. The backscatter
    datasets include data collected using the  RESON 8101ER multibeam sonar, Kongsberg
    300 kHz EM3002D multibeam sonar, and a Kongsberg 30 kHz EM300 multibeam sonar. Data
